import styled from 'styled-components'
import Img from '../../assets/jeffrey.png'

const Wrapper =styled.div`
 display:grid;
 h1{
    margin:0;
     padding:0;
 }


 h5{
    margin:0;
     padding:0;
    font-size:20px;
    font-weight:300;
}
 ${'' /* grid-template-colums:1fr 1fr ; */}
` 
const Text =styled.div`
margin:15vh 0;
z-index:100;

` 
const Image =styled.img`
position:absolute;
right:0;
bottom:5vh;
z-index:-1;
`
const Hero = () => {
    return (
        <Wrapper>
        <Text>
            <h1>Information Technology Specialist</h1>
            <h5>Eindhoven, North Brabant, Netherlands</h5>
            </Text>
            <Image src={Img} allt="" width="50%"/>
        </Wrapper>
    )
}

export default Hero
